  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0115223 includes underway
  - surface, meteorological, biological, physical and chemical data collected aboard
  the WECOMA during cruises W0002A, W0004B, W0007A, W0009A, W0101B, W0101C, W0103B,
  W0107A, W0109A, W0111B, W0202A, W0204A, W0207A, W0212A, W0302A, W0304A, W0309B,
  W9907A, W9909C and W9911A in the North Pacific Ocean from 1999-07-03 to 2003-10-01.
  These data include CONDUCTIVITY, WIND DIRECTION, FLUORESCENCE, WATER DEPTH, PHOTOSYNTHETIC
  ACTIVE RADIATION (PAR), LONGWAVE RADIATION - REFLECTED, AIR TEMPERATURE, WIND SPEED,
  SALINITY - SURFACE WATER, RELATIVE HUMIDITY, SHORTWAVE RADIATION - REFLECTED and
  SEA SURFACE TEMPERATURE. The instruments used to collect these data include thermosalinographs,
  CTD, echo sounder, GPS, fluorometer and anemometer. These data were collected by
  Adriana Huyer, Evelyn Sherr, Jack Barth, Jane Fleischbein and Robert Smith of Oregon
  State University and William T. Peterson of Northwest Fisheries Science Center -
  Newport as part of NEP. The Biological and Chemical Oceanography Data Management
  Office (BCO-DMO) submitted these data to NODC on 2013-11-01.nnThe following is the
  text of the abstract provided by BCO-DMO:nnUnderway MET data collected on GLOBEC
  LTOP cruises (1998-2004) aboard R/V Wecoma. Data are preliminary. No error-checking
  or in-situ calibrations (except for salinity) have been performed. Underway temperature
  and salinity calibration information is listed in the sensor calibration table (http://globec.whoi.edu/nep/reports/ccs_cruises/sensorcal.pdf)
  (PDF).\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
